line----> 95 ----- db. contents._findAndModify({ _id: ObjectId("5de8e8f02bf37b7aa5e93306") }, [], { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 07:17:02 GMT") }, '$set': { contentType: 'NEWS', title: 'East Africa floods: The River Nile bursts its banks', description: 'The River Nile has burst its banks in heavy rainfall in the West Nile region of Uganda, cutting off a major highway connecting the country. \n\nThe floods covered the vegetation along the Pakwach road on the Pakwach-Arua highway, the Ugandan Red Cross tweetedRain-triggered disasters, including flash floods and landslides, have killed at least 250 people and affected some three million people across East Africa in recent weeks, with about half of the deaths occurring in Kenya.\n\nSo, we should expect rain to fall at this time of year but this is far heavier than usual. Weather experts say the rains have been enhanced by a phenomenon called the Indian Ocean Dipole which, when positive, can cause a rise in water temperatures in the Indian Ocean of up to 2C.\n\nBBC', starring: undefined, director: undefined, tags: [ ObjectId("5deb725c16c2ad315f2d02b2") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5de8db5dcc446376c1110e8b") ], country: [ ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2f8"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d253") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/nile_1575445352-7c0635018268c19167d7d3d6aec37b45.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 07:17:02 GMT") } }, { new: false, upsert: false, projection: {} })
