line----> 98 ----- db. contents._findAndModify({ _id: ObjectId("5dfd2e5f11451162dbc26634") }, [], { '$setOnInsert': { createdAt: new Date("Mon, 23 Dec 2019 07:34:16 GMT") }, '$set': { contentType: 'NEWS', title: 'R. Kelly pleads not guilty to bribing official to get fake ID for Aaliyah', description: 'Singer R. Kelly on Wednesday pleaded not guilty to bribing an official to get a fake identification document for singer Aaliyah, then 15, the day before he married her, the latest charge in a criminal case accusing him of running a years-long scheme to recruit underage girls for sex. \n\nKelly, known for such hits as “I Believe I Can Fly” and “Bump N’ Grind,” entered his plea before U.S. District Judge Ann Donnelly in Brooklyn federal court by video conference from Illinois, where he is currently jailed. \n\nThe 52-year-old R&B singer, whose full name is Robert Kelly, was arrested on separate sets of charges brought by federal prosecutors in Brooklyn and Chicago and pleaded not guilty. The allegation involving Aaliyah, who died 18 years ago, was added in a superseding indictment in Brooklyn on December 5.\n\nProsecutors said that on August 30, 1994, Kelly caused another person to offer a bribe to a government official to create a fake ID for a person identified by the pseudonym “Jane Doe #1.” The person is Aaliyah, according to a source familiar with the matter.\n\nKelly, then 27, married Aaliyah (whose full name was Aaliyah Haughton) the following day. The marriage was annulled in 1995. Aaliyah died in a plane crash in the Bahamas in 2001.\n\nDouglas Anton, a lawyer for Kelly, said after Wednesday’s hearing that the bribery allegation was “ridiculous.” Anton added that Kelly was doing well in jail and was continuing to compose music. “It’s completely uplifting stuff,” Anton said. “He’s just a genius.” \n\nKelly is scheduled to go to trial in Brooklyn in May 2020. The singer had denied abuse allegations for decades before the latest charges. In 2008, he was tried on child pornography charges and found not guilty. \n\nThe Brooklyn prosecutors have charged Kelly with racketeering, accusing him and his entourage of inviting women and girls backstage after concerts, keeping them from friends and family and making them dependent on him financially .The Chicago prosecutors said Kelly had sexual contact with five minors and recorded sexually explicit videos of some of them. \n\nThey also accused Kelly of obstructing justice by using threats and bribes to keep his victims quiet. A trial in Chicago has been scheduled for April 27. In addition to the two federal cases, Kelly is facing charges from state prosecutors in Illinois and Minnesota. He has pleaded not guilty to those charges as well.\n\nSource\nSABC', starring: undefined, director: undefined, tags: [ ObjectId("5deb726f16c2ad315f2d02b7") ], isSeries: false, categories: [ ObjectId("5de8a19612f1876c9365ea47") ], subCategories: [ ObjectId("5de8dbedcc446376c1110ebd") ], country: [ ObjectId("5de8b686641f4253ad09d283"), ObjectId("5de8b686641f4253ad09d2e6"), ObjectId("5de8b686641f4253ad09d2ca"), ObjectId("5de8b686641f4253ad09d2cf"), ObjectId("5de8b686641f4253ad09d2ff"), ObjectId("5de8b686641f4253ad09d27a"), ObjectId("5de8b686641f4253ad09d2b9"), ObjectId("5de8b686641f4253ad09d2f8") ], language: undefined, isFree: true, priceDetail: undefined, createdBy: undefined, releaseDate: undefined, isFreeForAzam: true, boundingBox: undefined, cdnID: undefined, duration: undefined, imageThumb: 'https://s3.eu-west-1.amazonaws.com/com.azamtv2019/Aaliyah_1576822007-6d896191196e9549ba53af79d12bea39.jpg', packageID: [], vodType: undefined, series: [], images: [], videoURL: undefined, isEpisode: false, referenceChannelID: null, updatedAt: new Date("Mon, 23 Dec 2019 07:34:16 GMT") } }, { new: false, upsert: false, projection: {} })
